import React, { Component } from "react";
import M from 'materialize-css';
import "materialize-css/dist/css/materialize.min.css";

class Sidebar extends Component {
    componentDidMount() {
        var elem = document.querySelector(".sidenav");
        var instance = M.Sidenav.init(elem, {
            edge: "left",
            inDuration: 1000,
            draggable:false
        });

        
       // M.AutoInit();
    }

    render() {
        return (
            <div>
                <ul id="slide-out" className="sidenav">
                  <li className="no-padding">
                      <ul className="collapsible collapsible-accordion">
                          <li>
                              <a className="collapsible-header">MASTERS<i className="material-icons right">arrow_drop_down</i></a>
                                  <div className="collapsible-body">
                                    <ul>
                                      <li><a href="#!">Country</a></li>
                                      <li><a href="#!">State</a></li>
                                      <li><a href="#!">District</a></li>
                                      <li><a href="#!">PS</a></li>
                                      <li><a href="#!">PO</a></li>
                                      <li><a href="#!">VILL</a></li>
                                    </ul>
                                  </div>
                            </li>
                        </ul>
                    </li>
                    <li className="no-padding">
                      <ul className="collapsible collapsible-accordion">
                          <li>
                              <a className="collapsible-header">USERS<i className="material-icons right">arrow_drop_down</i></a>
                                  <div className="collapsible-body">
                                    <ul>
                                      <li><a href="#!">Chief Executive</a></li>
                                      <li><a href="#!">Business Executive</a></li>
                                      <li><a href="#!">Executive</a></li>
                                    </ul>
                                  </div>
                            </li>
                        </ul>
                    </li>
                </ul>
              <a href="#" data-target="slide-out" className="sidenav-trigger"><i className="material-icons">keyboard_arrow_right</i></a>
            </div>
        );
    }
}

export default Sidebar;
